PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?uri WHERE { ?uri wdt:P31 wd:Q482478 ; wdt:P355 wd:Q115703. }

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT (COUNT(DISTINCT ?item) AS ?c) WHERE { ?item wdt:P31 wd:Q11424; ?item wdt:P161 wd:Q41176. }

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?date WHERE { wd:Q53407 wdt:P570 ?date }

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?uri WHERE { ?uri wdt:P58 wd:Q155 </sparql> <!-- wdt:P58 is the Wikidata equivalent of "starring" --> ?uri wdt:P58 wd:Q13335 . </sparql> }

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/> SELECT ?n WHERE { wd:Q116621 wd:budget ?n }

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/> PREFIX wds: <http://www.wikidata.org/entity/statement/> SELECT DISTINCT ?runtime WHERE { wd:Q393439 wds:P577 ?runtime }

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/> SELECT DISTINCT ?num WHERE { wd:Q13002 wdt:P2047 ?num }

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX wdt: <http://www.wikidata.org/prop/> PREFIX wd: <http://www.wikidata.org/entity/> SELECT ?mainOccupation WHERE { wd:Q76 wdt:P106 ?occupation . ?occupation wdt:P31 ?mainOccupation . FILTER (strstarts(str(?mainOccupation), "Q") && ?mainOccupation != wd:Q76) }

PREFIX wd: <http://www.wikidata.org/entity/>
