PREFIX wdt: <http://www.wikidata.org/prop/direct/> SELECT ?europop WHERE { wd:Q142 dbr:European_Union wdt:P1082 ?europop }

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT (COUNT(DISTINCT ?uri) AS ?c) WHERE { ?uri wdt:P31 wd:Q11491. BIND(str(?uri) AS ?companyURI). OPTIONAL { ?uri wdt:P97 ?industry. FILTER(regex(?industry, "advertising", "i")). } UNION { ?uri wdt:P279* wd:Q47471090. } }

