PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?uri WHERE { ?uri a wd:Actor . OPTIONAL { ?uri wdt:P20 ?place } . OPTIONAL { ?place wdt:P17 wd:Germany } . FILTER NOT EXISTS { ?uri wdt:P31 wd:Q5 } UNION BIND(wd:Germany AS ?place) ?uri wdt:P20 ?place . FILTER (?place = wd:Germany) }

