PREFIX p: <http://www.wikidata.org/prop/>
SELECT DISTINCT ?uri WHERE { ?uri a <http://www.wikidata.org/ontology#Athlete> ; wdt:P2047 ?n. FILTER ( ?n > 2.0 ) }

